(function($) {

  $.fn.breadcrumb = function() {

    return this.each(function() {

      var el = $(this);
      var dropdown = el.clone();

      dropdown.removeClass('breadcrumb');
      dropdown.addClass('dropdown')
              .addClass('dropdown-left')
              .addClass('breadcrumb-dropdown');

      dropdown.attr('id', 'breadcrumb-menu');
      dropdown.find('.nav-icon').remove();
      dropdown.find('.breadcrumb-list').removeClass('nav-bar').removeClass('breadcrumb-list').addClass('dropdown-list');
      dropdown.find('.breadcrumb-link').removeClass('breadcrumb-link');
      dropdown.find('.breadcrumb-label').removeClass('breadcrumb-label');

      el.append(dropdown);

    });

  };

})(jQuery);
var Content = function() {

  var root = $('.main');

  var element = function(selector) {
    return root.find(selector);
  };

  var focus = Focus();

  var scroll = {

    mainbar: 0,
    sidebar: 0,
    
    save : function() {      
      scroll.mainbar = $('.mainbar').scrollTop();
      scroll.sidebar = $('.sidebar').scrollTop();
    },

    restore: function() {
      if($('.mainbar')[0]) $('.mainbar')[0].scrollTop = scroll.mainbar;
      if($('.sidebar')[0]) $('.sidebar')[0].scrollTop = scroll.sidebar;
    }

  };

  var on = function() {

    // make sure everything is nice and clean first
    off();

    // setup the breadcrumb mobile version
    element('.breadcrumb').breadcrumb();

    // setup the sidebar toggle
    element('.sidebar').sidebar();

    // register all keyboard shortcuts within the main container
    root.shortcuts();

    app.delay.start('message', function() {
      element('.message-is-notice').trigger('click');
    }, 3000);

    element('.message a, .message').on('click', function(e) {
      element('.mainbar .field-with-error').removeClass('field-with-error');
      element('.message').remove();
      app.delay.stop('message');
      return false;
    });

    // hook up the main form
    Form('.main .form', {
      submit: function() {
        scroll.save();
      },
      redirect: function(response) {

        if($.type(response) == 'object' && response.url) {
          open(response.url);                        
        } else {
          replace(response.content);
        }

      }
    });

    // recall the focus and caret position
    focus.on('.mainbar .form');

  };

  // clean all registered events and remove generated elements
  var off = function() {
    
    // stop all delays
    app.delay.stop();

    // stop caret recording
    focus.off();

    // remove all shortcuts
    $(document).unbind('keydown.shortcuts');

    // remove window resizing events
    $(window).off('resize');

  };

  var open = function(url, state) {

    app.load(url, 'content', function(response) {
      // handle redirects
      if(response.url) {
        open(response.url);
      } else {
        replace(response.content, url);
      }
    });

  };

  var replace = function(content, url) {

    // close all context menus
    $(document).trigger('click.contextmenu');

    // close all modals
    app.modal.close();      

    root.html(content);    

    // change the history
    if(url) {
      if(window.location.href != url) {                
        focus.forget();            
        try {
          path = url.replace(window.location.origin, '');
          window.history.pushState({path: path}, document.title, path);                    
        } catch(e) {
          window.location.href = url;
        }
      }
    }

    // switch on all events for the mainbar
    on();

    // restore the previous scroll position
    scroll.restore();          

  };

  var reload = function() {
    scroll.save();
    open(document.location);
  };

  var shortcuts = function() {
    root.shortcuts();
  };

  var form = function() {
    return $('.main .form');
  };

  var setup = function() {

    $(window).on('popstate', function(e) {      
      open(document.location);
    });

    on();

  };

  return {
    root : root,
    element: element,
    on: on,
    off: off,
    open: open,
    replace: replace,
    reload: reload,
    shortcuts: shortcuts,
    form: form,
    focus: focus,
    setup: setup, 
    scroll: scroll
  };

};
var Delay = function() {

  var delays = {};

  var start = function(id, callback, time) {
    stop(id);
    delays[id] = setTimeout(callback, time);
  };

  var stop = function(id) {
    if(!id) {
      for(var id in delays) {
        if(delays.hasOwnProperty(id)) stop(id);
      }
    } else if(delays[id]) {
      clearTimeout(delays[id]);      
    }
  };

  return {
    start: start,
    stop: stop
  };

};
(function($) {

  $.fn.dropdown = function() {

    return this.each(function() {

      var parent = $(this);

      if(parent.is(document)) {
        // kill all dropdowns when the document is being clicked
        parent.on('click.dropdown', function() {
          parent.find('.dropdown').not('.contextmenu').hide();
        });
        // kill all dropdowns on escape
        parent.on('keydown.dropdown', function(e) {
          if(e.keyCode == 27) parent.trigger('click.dropdown');
        });
        // kill all dropdowns when the browser window is being resized
        $(window).resize(function() {
          parent.find('.dropdown').not('.contextmenu').hide();
        });
      }

      parent.find('.dropdown').hide();
      parent.on('click', '[data-dropdown]', function() {
        parent.trigger('click.dropdown');
        $($(this).attr('href')).show();
        return false;
      });

    });

  };

})(jQuery);
var Focus = function() {

  var elements = null;
  var caret    = 0;
  var id       = false;

  var store = function(form) {

    var element = form.find('input:focus, select:focus, textarea:focus');

    if(element.length > 0) {
      caret = element.caret().end;        
      id    = element.attr('id');
    } 

  };

  var recall = function() {

    if(id) {
      element = $('#' + id);
      element.caret(caret);
      element.focus();
    } 

  };

  var forget = function() {
    element = null;
    id      = null;
    caret   = 0;
  };

  var on = function(form) {

    form     = $(form);
    elements = form.find('input, select, textarea');
    elements.on('keyup.caretchange, click.caretchange', function() {
      store(form);
    });

    recall();

  };

  var off = function() {
    if(elements) elements.off('keyup.caretchange, click.caretchange');
  };

  return {
    store: store,
    forget: forget,
    recall: recall,
    on: on,
    off: off
  };

};
var Form = function(form, params) {

  var form = $(form);

  var defaults = {
    focus    : false,
    returnTo : false,
    url      : form.attr('action'),
    redirect : function(response) {},
    submit   : function(form) {}
  };

  var options = $.extend({}, defaults, params);

  form.find('[data-focus=true]').fakefocus('input-is-focused');

  // setup all field plugins  
  form.find('[data-field]').each(function() {
    var el  = $(this);
    var key = el.data('field');
    if(el[key]) el[key]();
  });

  // keep changes on updates to avoid data loss
  if(form.data('keep')) {
    
    form.on('keep', function() {
      $.post(form.data('keep'), form.serializeObject())
    });

    form.on('change.keep', ':input', function() {
      form.trigger('keep');
    });

  }

  // focus the right field  
  if(options.focus) {
    form.find('[autofocus]').focus();    
  }

  // don't setup a form submission action
  if(form.data('autosubmit') == 'native') {
    return true;
  }

  // special treatment for addit buttons
  form.find('.btn-addit').on('click', function() {
    // change the form action
    form.attr('action', $(this).data('action'));
  }); 

  // hook up the form submission
  form.on('submit', function(e) {

    // auto submission can be switched off via a data attribute
    // to setup your own submission action
    if(form.data('autosubmit') == false) {
      return false;
    } 

    // submission event
    options.submit(form);

    // on submit all errors should be removed. Looks weird otherwise
    form.find('.field-with-error').removeClass('field-with-error');

    // show the loading indicator
    if(app) app.isLoading(true);

    // handle the post request for the form and serialize all the data
    $.post(form.attr('action'), form.serializeObject(), function(response, message, xhr) {

      // hide the loading indicator
      if(app) app.isLoading(false);
    
      // handle redirection and replacement of data
      options.redirect(response);

    });

    return false;

  });

};
(function($) {

  $.fn.message = function() {

    return this.each(function() {

      var message = $(this);
      var form    = message.closest('form');

      message.on('close', function() {
        message.remove();
        form.find('.field-with-error').removeClass('field-with-error');
        form.find('[autofocus]').focus();
        $(document).trigger('keyup.center');
      });

      message.on('click', function() {
        message.trigger('close');
      });

    });

  };

})(jQuery);
var Modal = function(app) {

  // create a new modal root
  var root = $('<div class="modal" tabindex="0"></div>');

  // checks if the modal is opened in an overlay
  var isOverlay = function() {
    return $('.modal').length > 0;
  };

  // initialize all modal events as soon 
  // as the modal content is loaded
  var on = function() {

    // make sure everything is clean first
    off();

    var content = $('.modal-content');

    // enable modal shortcuts
    content.shortcuts();

    // enable the content resizer
    content.center(3 * 16);

    // close the modal when the cancel button is being clicked
    content.find('.btn-cancel').on('click', function() {
      if($('.modal').length) {
        close();
        return false;        
      }
    });

    // avoid closing the modal on clicks on the modal content
    content.on('click', function(e) {
      e.stopPropagation();
    });

    // remove any error messages on click
    content.find('.message').on('click', function() {
      content.find('.field-with-error').removeClass('field-with-error');
      $(this).remove();
    });

    // setup the form
    var form = content.find('.form');

    // switch to native form 
    // submission on modal pages
    if(!isOverlay()) {
      form.data('autosubmit', 'native');      
    }

    Form(form, {
      focus: true,
      redirect: function(response) {
        if($.type(response) == 'object') {
          if(response.url) {
            app.content.open(response.url);                        
            return;
          } else if(response.content) {
            replace(response.content);
            return;
          } 
        } 
        window.location.reload();
      }
    });

  };

  var off = function() {

    // stop all delays
    app.delay.stop();

    // make sure to properly remove modal events
    $(document).off('keyup.modal');
    $(window).off('resize.modal');

    // remove all modal keyboard shorcuts
    $.shortcuts.reset();

  };

  // open a modal by url
  var open = function(url, onLoad) {

    // close all context menus
    $(document).trigger('click.contextmenu');

    // make sure there's no modal
    close();

    // switch off content events
    // to avoid conflicts    
    app.content.off();

    // load the modal view
    app.load(url, 'modal', function(response) {

      // paste the html into the modal container
      root.html(response.content);

      // add the modal to the body
      $('body').append(root);

      // make sure the modal closes when 
      // the backdrop is being clicked
      root.on('click', function() {
        close();
      });

      if($.type(onLoad) == 'function') {
        onLoad();
      }

      // initialize all events
      on();

    });

  };

  // replace the modal content
  var replace = function(content) {

    // replace the html
    $('.modal-content').parent().html(content);

    // initialize all events
    on();

  };

  // removes the modal root
  var close = function() {

    app.content.scroll.save();

    if(!app.hasModal()) return true;

    // switch off all modal events
    off();

    // kill the modal container
    $('.modal').remove();

    // switch content events back on
    app.content.on();
    
  };

  // return the modal form element
  var form = function() {
    return $('.modal-content form');
  };

  var setup = function() {

    // init an existing modal on load
    if(app.hasModal()) {      
      on();
    }

  };

  return {
    root: root,
    open: open,  
    close: close,
    replace: replace,
    form: form,
    setup: setup
  };

};
var Search = function() {

  $(document).on('click', function() {
    $('#search').hide();
  });

  $(document).on('click', '[href="#search"]', function(e) {
    e.stopPropagation();

    var $search = $('#search');

    if($search.is(':visible')) {
      $search.hide();
    } else {
      $search.show();
      $search.find('.search-input').focus();
    }

    return false;

  });

  $(document).on('click', '#search', function(e) {
    e.stopPropagation();
  });

  var navigate = function(key) {

    var list   = $('#search .search-results li');
    var active = list.filter('.active');
    var index  = list.index(active);

    switch(key) {
      case 13:
        active.find('a').trigger('click');
        return true;
      case 38:
        var index = index - 1;
        break;
      case 40:
        var index = index + 1;
        break;
    }
      
    if(index < 0) {
      index = -1;
    }
    
    if(index >= list.length) {
      index = 0;
    }

    active.removeClass('active');
    list.eq(index).addClass('active');

  };

  $(document).on('keyup', '.search-input', function(e) {

    switch(e.keyCode) {
      case 13: // enter
      case 38: // up
      case 40: // down
        navigate(e.keyCode);
        e.preventDefault();
        break;
      default:
        var q   = $(this).val();
        var api = $('#search form').attr('action');
        $('.search-results').load(api, {q: q});
        break;
    }

  });

  $(document).on('submit', '#search form', function() {
    return false;
  });

};
(function($) {

  $.shortcuts = {

    events : {},

    add : function(key, event) {
      // don't register an event twice
      if(key in this.events) return true;

      // register the event
      this.events[key] = event;

      // bind it to the document's keydown event
      $(document).bind('keydown.shortcuts', key, function(e) {
        e.preventDefault();
        event(e);
      });

    },

    reset : function() {
      $(document).unbind('keydown.shortcuts');
      this.events = {};
    }

  };

  $.fn.shortcuts = function() {

    $.shortcuts.reset();

    return this.each(function() {

      // register the keyboard shorcuts for this element
      $(this).find('[data-shortcut]').each(function() {

        var item = $(this);
        var key  = item.data('shortcut');

        $.shortcuts.add(key, function(e) {

          if(item.is('button')) {
            item.trigger('click');
          } else if(item.is('a')) {
            if(item.attr('target') == '_blank') {
              window.open(item.attr('href'));
            } else if(item.is('[data-modal]')) {
              app.modal.open(item.attr('href'));
            } else if(item.is('[data-upload]')) {          
              return false;
            } else {
              app.content.open(item.attr('href'));
            }
          }

        });

      });

    });

  };

})(jQuery);
(function($) {

  $.fn.sidebar = function() {

    return this.each(function() {

      var sidebar = $(this);

      if(localStorage.getItem('sidebar') == 1) {
        sidebar.addClass('sidebar-expanded');
      } else {
        sidebar.removeClass('sidebar-expanded');
      }

      sidebar.find('.sidebar-toggle').on('click', function() {

        if(sidebar.hasClass('sidebar-expanded')) {
          sidebar.removeClass('sidebar-expanded');
          localStorage.sidebar = 0;
        } else {
          sidebar.addClass('sidebar-expanded');
          localStorage.sidebar = 1;
        }

        return false;

      });


      var textareas = $('.mainbar .form textarea');
      var draggable = sidebar.find('.draggable');

      draggable.draggable({
        helper: function(e, ui) {
          return $('<div class="draggable-helper"></div>');
        },
        start: function(e, ui) {
          
          var url = $(this).data('url');

          if(url) {
            ui.helper.html('<img src="' + url + '">');            
            ui.helper.addClass('draggable-helper-with-image');
          } else {
            ui.helper.text($(this).data('helper'));
          }

        }
      });

      textareas.droppable({
        hoverClass: 'over',
        accept: draggable,
        drop: function(e, ui) {
          $(this).insertAtCursor(ui.draggable.data('text'));
        }
      });

    });

  };

})(jQuery);
(function($) {

  $.support.uploader = $.support.upload && $.support.fileReader;

  $.fn.uploader = function(complete) {

    if(!$.support.uploader) return false;

    var form   = $(this);
    var upload = function(uploads) {

      var done = false;

      app.isLoading(true);
      $('body').addClass('loading');

      $.upload(uploads, {
        url: form.attr('action') + '?csrf=' + form.find('[name=csrf]').val(),
        complete: function() {
          if(done == false) {
            done = true;
            app.isLoading(false);
            $('body').removeClass('loading');
            complete();
          }
        }
      })

    };

    $(document).filedrop('destroy').filedrop({
      dragenter : function(e) {      
        var transfer = e.originalEvent.dataTransfer;
        if(transfer.types != null && (transfer.types.indexOf ? transfer.types.indexOf('Files') != -1 : transfer.types.contains('application/x-moz-file'))) {
          $('body').addClass('over');
        }
      },
      drop: function() {
        $('body').removeClass('over');
      },
      dragleave: function() {
        $('body').removeClass('over');
      },
      files : function(uploads) {
        upload(uploads);
      }
    });

    $('[data-upload]').on('click', function() {
      form.find('input[type=file]').trigger('click').on('change', function() {
        upload(this.files);
      });
      return false;
    });

  };

})(jQuery);